IF OBJECT_ID('dbo.proc_transform_322', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_322;
GO
CREATE PROCEDURE dbo.proc_transform_322
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_322
    SET payload = LEFT(payload, 1000) + N'|V4-322|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_322;
END
